package neetcode150.a_arrays;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map.Entry;

// https://leetcode.com/problems/valid-anagram/description/
// https://www.youtube.com/watch?v=9UtInBqnCgA
public class _2_242_ValidAnagram {

	public boolean isAnagram2(String s, String t) {
		char[] sCharArr = s.toCharArray();
		char[] tCharArr = t.toCharArray();

		if (sCharArr.length != tCharArr.length)
			return false;

		Arrays.sort(sCharArr);
		Arrays.sort(tCharArr);

		for (int i = 0; i < sCharArr.length; i++) {
			if (sCharArr[i] != tCharArr[i])
				return false;
		}
		return true;
	}

	public boolean isAnagram(String s, String t) {
		if (s.length() != t.length())
			return false;

		HashMap<Character, Integer> firstHashmap = new HashMap<Character, Integer>();
		HashMap<Character, Integer> secondHashmap = new HashMap<Character, Integer>();

		// push first string character frequencies
		for (int i = 0; i < s.length(); i++) {
			if (!firstHashmap.containsKey(s.charAt(i))) {
				firstHashmap.put(s.charAt(i), 1);
			} else {
				int prevVal = firstHashmap.get(s.charAt(i));
				firstHashmap.put(s.charAt(i), prevVal + 1);
			}
		}
		// push second string character frequencies
		for (int i = 0; i < t.length(); i++) {
			if (!secondHashmap.containsKey(t.charAt(i))) {
				secondHashmap.put(t.charAt(i), 1);
			} else {
				int prevVal = secondHashmap.get(t.charAt(i));
				secondHashmap.put(t.charAt(i), prevVal + 1);
			}
		}

		if (firstHashmap.entrySet().size() != secondHashmap.entrySet().size())
			return false;

		// check if every character in first hashmap exists in second
		for (Entry<Character, Integer> entry : firstHashmap.entrySet()) {
			Character key = entry.getKey();

			if (!secondHashmap.containsKey(key)) {
				return false;
			}

			int firstKeyVal = firstHashmap.get(key).intValue();
			int secondKeyVal = secondHashmap.get(key).intValue();
			if (firstKeyVal != secondKeyVal) {
				return false;
			}
		}
		// check if every character in second hashmap exists in first
		for (Entry<Character, Integer> entry : secondHashmap.entrySet()) {
			Character key = entry.getKey();

			if (!firstHashmap.containsKey(key)) {
				return false;
			}

			int firstKeyVal = firstHashmap.get(key).intValue();
			int secondKeyVal = secondHashmap.get(key).intValue();
			if (firstKeyVal != secondKeyVal) {
				return false;
			}
		}

		return true;

	}

	public static void main(String[] args) {
		_2_242_ValidAnagram obj = new _2_242_ValidAnagram();

		String s1 = "anagram", t1 = "nagaram";
		String s2 = "sdfram", t2 = "nagaram";
		String s3 = "\"\"";
		String t3 = "\"\"";

//		System.out.println(obj.isAnagram(s1, t1));
//		System.out.println(obj.isAnagram(s2, t2));
		System.out.println(obj.isAnagram2(s3, t3));

	}

}
